import React, { useEffect, useState } from "react";
import { axios } from "axios";

const AdvicePage = () => {
  const [data, setData] = useState();
  useEffect(() => {
    const getData = async () => {
      const responseData = await axios
        .get("/api/advice")
        .then(res => res.data)
        .catch(err => err);

      setData(responseData);
    };

    getData();
  }, [data]);

  console.log(data);

  return <div>AdvicePage</div>;
};

export default AdvicePage;
